import React from 'react'
import '../styles/Navbar.css';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <div className="nav">
            <Link href="">hello</Link>
            <Link href="">hello</Link>
            <Link href="">hello</Link>
            <Link href="">hello</Link>
            <Link href="">hello</Link>
        </div>
    )
}

export default Navbar
